import './Calendar.css';
import { CALENDAR } from '../../const.js';

function Calendar() {
    return (
        <div id='calendar' className="Service">
            <div class="header">
                <h1>CALENDAR SECTION</h1>
            </div>

            <div className="serviceGrid">


            {CALENDAR.map((calendar) => {
                return (
                    <div className='serviceContainer'>
                            <h3>{calendar.name}</h3>
                            <div className='languageText'>

                        <div className='serviceBox'>

                            <img className='contentImage' src={calendar.src} alt='' />
                            <p>{calendar.desc}</p>

                        <a href={calendar.link}> learn more </a>
                        </div>
                        </div>
                    </div>
                );
            })}


            </div>
        </div>
    );
}

export default Calendar
